import React from "react";
import "../styles/about.css";
import AboutImg from "../img/zaloguj sie1.png";
import Dates from "../components/Dates";
import Invitation from "../img/Invitation.pdf";

const About = () => {
	return (
		<section className="about section" id="about">
			<h2 className="section-title">Our Story</h2>
			<span className="section-subtitle">From the beginnings</span>

			<div className="about__container container grid">
				<img src={AboutImg} alt="my" className="about__img"></img>
				<div className="about__data">
					<Dates />
					<p className="about__description">Poznali się w liceum, a konkretnie na V Lo w Oliwie. 
					Na pierwszej randce poszli do kina, a potem na romantyczny spacer po molo w Sopocie. 
					Lubią wspólne podróże i mieli okazję przejechać rowerem całą Polskę. 
					Po wielu latach wspólnych doświadczeń, Grzes postanowił oświadczyć się Julii i teraz są zaręczeni. 
					Uważani są za cudowną parę w romantycznym stylu.
					</p>

					<a download="" href={Invitation} className="button button--flex">Download Invitation</a>
				</div>
			</div>
		</section>
	)
}

export default About
